import React, { useState } from 'react';

const App = () =>{
    const [name,setName] = useState("");
    const InputEvent = (event) =>{
        setName(event.target.value);
    }
    return(
        <>
        <h1 className="head">hello</h1>
        <input
            type="text"
            placeholder="Enter Your Name"
            onChange={InputEvent}
            value={name}
        />
        <button onClick={name}></button>
        </>
    );
}

export default App;
